import React, { useState } from "react";
import {
  Text,
  TextInput,
  View,
  StyleSheet,
  TouchableOpacity,
  SafeAreaView,
  Alert,
} from "react-native";
import { StatusBar } from 'expo-status-bar';
import * as Animatable from "react-native-animatable";
import { LinearGradient } from 'expo-linear-gradient';
import Axios from "axios";
import Logo from '../components/Logo'

export default function LoginScreen({ navigation }) {
  const [state, setState] = useState({
    username: "",
    password: "",
    isValidUser: true,
    isValidPassword: true,
  });

  const textUsernameChange = (val) => {
    setState({
      ...state,
      username: val,
    });
  };

  const handlePasswordChange = (val) => {
    setState({
      ...state,
      password: val,
    });
  };

  const handleLogin = () => {
    if (state.username.trim() === "" || state.password.trim() === "") {
      Alert.alert("Error", "Please enter both email and password.");
      return;
    }

    Axios.post("http://localhost:8000/data/signin", {
      username: state.username,
      password: state.password,
    })
      .then((response) => {
        if (response.data.status === "success") {
          navigation.push("Dashboard", { username: state.username });
        } else {
          Alert.alert("Error", "Email and password do not match.");
        }
      })
      .catch((e) => {
        Alert.alert("Error", "An error occurred during login.");
      });
  };

  return (
    <View>
      <SafeAreaView style={{ flex: 1, backgroundColor: "lightgrey" }}>
        <View style={styles.container}>
          <StatusBar style="auto" />
        </View>
      </SafeAreaView>
      <View style={styles.container}>
        <Animatable.View animation="rubberBand" duration={1000}>
          <View style={styles.data}>
            <View style={styles.logoContainer}>
              <Logo style={styles.logo} />
            </View>
            <Text style={styles.applego}>APPLEGO</Text>
            <Text style={styles.userdata}>Username</Text>
            <TextInput
              placeholder="Enter Username"
              style={styles.username}
              onChangeText={(e) => textUsernameChange(e)}
            />

            <Text style={styles.userdata}>Password</Text>
            <TextInput
              secureTextEntry
              placeholder="Password"
              style={styles.username}
              onChangeText={(e) => handlePasswordChange(e)}
            />

            <TouchableOpacity onPress={() => navigation.navigate('ResetPasswordScreen')}>
              <Text style={{ color: "black", fontSize: 14, textAlign: "center", alignSelf: "center", paddingTop: 10 }}>
                Forgot Password ?
              </Text>
            </TouchableOpacity>

            <TouchableOpacity onPress={handleLogin}>
              <LinearGradient colors={['#f72855', '#f72855']} style={styles.LoginUser}>
                <Text style={[styles.Button1, { fontWeight: "bold", color: "white" }]} >Login</Text>
              </LinearGradient>
            </TouchableOpacity>
            <Text style={styles.signup} onPress={() => navigation.navigate('RegisterScreen')}>Don't have an account? Sign Up </Text>
          </View>
        </Animatable.View>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    height: "100%",
    width: "100%",
    backgroundColor: "#f55164",
  },
  data: {
    marginTop: 60,
    backgroundColor: "rgba(255, 190, 123, 0.6)", 
    height: 700,
    paddingTop: 80,
    alignContent: 'center',
    alignSelf: "center",
    width: "95%",
    borderRadius: 20,
  },
  username: {
    fontFamily: "sans-serif", 
    alignSelf: "center",
    padding: 15,
    textAlign: "center",
    borderBottomColor: "rgba(100,50,40,0.2)",
    borderBottomWidth: 1,
    width: "80%",
    backgroundColor: "#d8dbd7",
    justifyContent: "center",
    fontSize: 20,
    borderRadius: 10
  },
  Button: {
    padding: 10,
    marginTop: 20,
    backgroundColor: "lightgreen",
    textAlign: "center",
    alignSelf: "center",
  },
  logoContainer: {
    alignItems: "center",
  },
  logo: {
    width: 200, 
    height: 200, 
  },
  LoginUser: {
    justifyContent: "center",
    alignContent: 'center',
    alignSelf: "center",
    marginTop: 20,
    padding: 15,
    width: "80%",
    borderRadius: 10
  },
  Button1: {
    alignSelf: "center",
    fontSize: 20,
    justifyContent: "space-between",
  },
  userdata: {
    paddingTop: 20,
    paddingBottom: 10,
    alignSelf: "center",
    color: "#eff2e9",
    fontSize: 20,
    justifyContent: "center"
  },
  applego: {
    paddingBottom: 20,
    alignSelf: "center",
    color: "#eff2e9",
    fontSize: 40,
    fontWeight: "bold", 
    justifyContent: "center",
  },
  signup: {
    paddingTop: 10,
    color: "#eff2e9",
    fontSize: 17,
    alignSelf: "center",
  }
});
